import React, { Component } from 'react';
import Grid from '@material-ui/core/Grid';
import Header from './Header';

const Main = ({children}) => (
  <div>
    <Header />
    <Grid container justify="center">
      <Grid item xs={12} style={{ marginTop: 30 }}>
        {children}
      </Grid>
    </Grid>
  </div>
)

export default Main
